function loadVimeoBackground( nodeId, vimeoId )
{
var xhttp = new XMLHttpRequest();
xhttp.onreadystatechange = function () {
if ( this.readyState == 4 && this.status == 200 )
{
var parser  = new DOMParser();
var xmlDoc  = parser.parseFromString( this.responseText, "text/xml" );
var imageBg = xmlDoc.getElementsByTagName( "thumbnail_large" )[0].innerHTML;
$( '.video_preview' + nodeId ).css( 'background-image', 'url(' + imageBg + ')'  );
}
};
xhttp.open( "GET", "https://vimeo.com/api/v2/video/" + vimeoId + ".xml", true );
xhttp.send();
}
for (var nodeId in CMSSpace.vimeo_videos)
{
loadVimeoBackground( nodeId, CMSSpace.vimeo_videos[nodeId] );
}
